# Function to plot the data
def plot_data(datasets):
    for dataset in datasets:
        plt.figure(figsize=(10, 4))
        plt.grid()
        plt.xlabel('Number of active threads', fontsize=11)
        plt.ylabel('Average response times in ms', fontsize=11)
        plt.xlim((0, 100))
        plt.ylim(dataset["result"]["ylim"])
        plt.title(dataset["result"]["title"] + " Time VS Threads")
        plt.xticks(range(0, 101, 10))

        for service in dataset["result"]["series"]:
            x_values, y_values = zip(*service["data"])

            plt.plot(x_values, y_values, 'o-', label=service["label"], color=service["color"], markersize=4, )

        plt.legend()
        # plt.show()
        plt.tight_layout(pad=2.0)
        plt.savefig(dataset["result"]["title"] + '.png', pad_inches=0.1, bbox_inches='tight', dpi=300)


# Plotting the data
datasets = [openWhiskData, summaryWithoutOpenWhiskData,nuclioData, knativeData, fissionData, openFaasData, summaryData]
plot_data(datasets)
